var title_f0_54_876="CHOP chemotherapy NHL";
var content_f0_54_876=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F66136&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F66136&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    CHOP chemotherapy for non-Hodgkin lymphoma",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td colspan=\"3\">",
"        <strong>",
"         CHOP-21",
"        </strong>",
"        chemotherapy consists of four agents:",
"        <strong>",
"         C",
"        </strong>",
"        yclophosphamide (Cytoxan), Doxorubicin (Adriamycin,",
"        <strong>",
"         H",
"        </strong>",
"        ydroxydaunomycin), Vincristine (",
"        <strong>",
"         O",
"        </strong>",
"        ncovin), and",
"        <strong>",
"         P",
"        </strong>",
"        rednisone. One complete course is given every 21 days. Full treatment usually consists of six to eight such courses.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\">",
"        Drug",
"       </td>",
"       <td class=\"subtitle2\">",
"        Dose and route",
"        <sup>",
"         [1,2]",
"        </sup>",
"       </td>",
"       <td class=\"subtitle2\">",
"        Given on day(s)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cyclophosphamide",
"       </td>",
"       <td>",
"        750 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        IV",
"       </td>",
"       <td>",
"        Day 1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Doxorubicin",
"       </td>",
"       <td>",
"        50 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        IV",
"       </td>",
"       <td>",
"        Day 1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vincristine",
"       </td>",
"       <td>",
"        1.4 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        IV (maximum 2 mg)",
"       </td>",
"       <td>",
"        Day 1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Prednisone",
"       </td>",
"       <td>",
"        100 mg per day orally",
"       </td>",
"       <td>",
"        Days 1 through 5",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     References:",
"     <br>",
"      <ol>",
"       <li>",
"        McKelvey EM, Gottlieb JA, Wilson HE, et al. Hydroxyldaunomycin (Adriamycin&reg;) combination chemotherapy in malignant lymphoma. Cancer 1976; 38:1484.",
"       </li>",
"       <li>",
"        Fisher RI, Gaynor ER, Dahlberg S, et al. Comparison of a standard regimen (CHOP) with three intensive chemotherapy regimens for advanced non-Hodgkin's lymphoma. N Engl J Med 1993; 328:1002.",
"       </li>",
"      </ol>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
